export default(c=4)=>{const e=c-1;return(l,n,f)=>{n.prototype.financialQuarter=function(){const t=Math.floor(this.month()/3-e/3)+1;return t>0?t:4},n.prototype.financialYear=function(){return this.financialQuarter()===4?this.year()-1:this.year()};const o=n.prototype.startOf;n.prototype.startOf=function(t,i){if(t==="financialYear")return this.financialQuarter()===4?o.bind(this.startOf("financialQuarter"))("year").month(e):o.bind(this)("year").month(e);if(t==="financialQuarter"){const r=this.month()+1,a=Math.round(r%3)-1,p=a<0?2:a;return this.subtract(p,"month").startOf("month")}return o.bind(this)(t,i)};const h=n.prototype.endOf;n.prototype.endOf=function(t,i){if(t==="financialYear"){let r;return this.financialQuarter()===4&&(r=o.bind(this)("year").subtract(1,"year").month(e)),r=o.bind(this)("year").month(e),r.add(11,"month").endOf("month")}return t==="financialQuarter"?this.startOf("financialQuarter").add(2,"month").endOf("month"):h.bind(this)(t,i)};const u=n.prototype.isSame;n.prototype.isSame=function(t,i){if(i==="financialYear"){const r=this.financialYear(),a=f(t).year();return r===a}if(i==="financialQuarter"){const r=this.financialQuarter(),a=f(t).financialQuarter();return r===a}return u.bind(this)(t,i)}}};
